import { React, useState, useEffect } from 'react'
import '../index.css'


export default function TimelineL2(props) {
    const [hovering1, setHovering1] = useState(false);

    const display1 = {
        visibility: hovering1 === true ? 'visible' : 'hidden'
    }

    useEffect( () => {
        console.log(hovering1)
        console.log(display1)
    })

    const display2 = {
        display: props.line2 == "" ? 'initial' : 'initial'
    }

    return (
        <div className="timeline-grid-l2" onMouseOver={() => {setHovering1(true)}} onMouseOut={() => {setHovering1(false)}}>

            <div className="timeline-grid-item gridFromTo1">
                {props.time}
            </div>

            <div className="gridFromTo3">
                <div className="vertical-line">
                </div>
            </div>

            <div className="timeline-grid-item semi-bold gridFromTo2">
                {props.main}
            </div>

            <div className="timeline-grid-item italics font14 gridFromTo4">
                {props.minor}
            </div>

            <div style={{display1}} className="timeline-grid-item gridFromTo5-2">
                <ul className="marginLess">
                    <li className="font14 colorGrey">{props.line1}</li>
                    <li className="font14 colorGrey">{props.line2}</li>
                </ul>
            </div>

        </div>
    )
}
